import React from "react";
import { useParams } from "react-router-dom";

const Ordered = () => {
  const { id } = useParams();

  return (
    <div className="container">
      <div
        className="payme card"
        style={{
          maxWidth: "500px",
          marginTop: "50px",
          padding: "20px",
        }}
      >
        <img
          src="https://cdn.paycom.uz/documentation_assets/power-by-Payme.svg"
          alt="payme"
          height={"80px"}
          style={{ margin: "0 auto" }}
        />
        <div class="row">
          <div class="input-field col s12">
            <input value="" id="number" type="number" class="validate" />
            <label htmlFor="number">Введите сумму (мин. 1000)</label>
          </div>
        </div>
        <div className="actions">
          <button className="btn mr-1">Оплатить</button>
          <button className="btn">Отменить</button>
        </div>
      </div>
    </div>
  );
};

export default Ordered;
